import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

function CompanyRegister(props) {
  const [companyName, setCompanyName] = useState('');
  const [companyLogo, setCompanyLogo] = useState(null);
  const [document, setDocument] = useState('');
  const [errors, setErrors] = useState({
    companyName: false,
    companyLogo: false,
    document: false,
  });
  const [isModalOpen, setIsModalOpen] = useState(false);

  const navigate = useNavigate();
  const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;

  const handleRegister = (e) => {
    e.preventDefault();

    const newErrors = {
      companyName: !companyName,
      companyLogo: !companyLogo,
      document: !document,
    };

    setErrors(newErrors);

    if (Object.values(newErrors).includes(true)) {
      if (!companyName) alert('Please enter a company name.');
      if (!companyLogo) alert('Please upload the company logo.');
      if (!document) alert('Please upload the required documents.');
      return;
    }

    // Show the modal on successful submission
    setIsModalOpen(true);

    // Uncomment this if you want to redirect the user after the modal is closed
    // navigate('/companylogin');
  };

  const handleLogoChange = (e) => {
    setCompanyLogo(e.target.files[0]);
  };

  const handleDocumentChange = (e) => {
    setDocument(e.target.files[0]);
  };

  const closeModal = () => {
    setIsModalOpen(false);
    // Redirect to the "company-login" page after closing the modal
    navigate('/companylogin');
  };

  return (
    <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
      <div style={{ padding: '20px', border: '1px solid #ddd', borderRadius: '8px' }}>
        <h2>Company Register</h2>
        <form onSubmit={handleRegister}>
          <div>
            <label>Company Name:</label>
            <input
              type="text"
              value={companyName}
              onChange={(e) => setCompanyName(e.target.value)}
              placeholder="Enter company name"
              style={{
                width: '100%',
                padding: '8px',
                marginBottom: '10px',
                borderColor: errors.companyName ? 'red' : '#ddd',
              }}
            />
          </div>

          <div>
            <label>Company Logo:</label>
            <input
              type="file"
              onChange={handleLogoChange}
              style={{
                width: '100%',
                padding: '8px',
                marginBottom: '10px',
                borderColor: errors.companyLogo ? 'red' : '#ddd',
              }}
            />
          </div>

          <div>
            <label>Upload Documents (e.g., tax/legal):</label>
            <input
              type="file"
              onChange={handleDocumentChange}
              style={{
                width: '100%',
                padding: '8px',
                marginBottom: '10px',
                borderColor: errors.document ? 'red' : '#ddd',
              }}
            />
          </div>

          <button
            type="submit"
            style={{
              padding: '10px',
              backgroundColor: '#4CAF50',
              color: 'white',
              border: 'none',
              borderRadius: '4px',
            }}
          >
            Register
          </button>
        </form>
      </div>

      <button
        onClick={() => navigate('/')}
        style={{
          position: 'fixed',
          bottom: '20px',
          left: '20px',
          padding: '10px',
          backgroundColor: '#f44336',
          color: 'white',
          border: 'none',
          borderRadius: '4px',
        }}
      >
        Back
      </button>

      {/* Modal for Success Message */}
      {isModalOpen && (
        <div
          style={{
            position: 'fixed',
            top: '0',
            left: '0',
            width: '100%',
            height: '100%',
            backgroundColor: 'rgba(0, 0, 0, 0.5)',
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
          }}
        >
          <div
            style={{
              backgroundColor: 'white',
              padding: '20px',
              borderRadius: '8px',
              textAlign: 'center',
              width: '400px',
            }}
          >
            <h3>Information Submitted</h3>
            <p>Your company information has been submitted. Please wait for SCAD to review and accept your submission.</p>
            <button
              onClick={closeModal}
              style={{
                padding: '10px',
                backgroundColor: '#4CAF50',
                color: 'white',
                border: 'none',
                borderRadius: '4px',
              }}
            >
              OK
            </button>
          </div>
        </div>
      )}
    </div>
  );
}

export default CompanyRegister;
